#
# Structure for table "re_question"
#

CREATE TABLE `re_question` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `sex` char(1) NOT NULL DEFAULT '' COMMENT '性别：A男性 B女性',
  `born_year` year(4) NOT NULL DEFAULT '0000' COMMENT '出生年份',
  `age` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '年龄',
  `age_scope` varchar(45) NOT NULL DEFAULT '' COMMENT '年龄区间',
  `education` char(1) NOT NULL DEFAULT '' COMMENT '教育水平',
  `occupation` char(1) NOT NULL DEFAULT '' COMMENT '职业',
  `area` varchar(45) NOT NULL DEFAULT '' COMMENT '行政区',
  `area_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '行政区划ID',
  `isknow` char(1) NOT NULL DEFAULT '' COMMENT '是否值得阅读活动，A:不知道，B：知道',
  `opinion` char(1) NOT NULL DEFAULT '' COMMENT '如何看待阅读活动',
  `cost` char(1) NOT NULL DEFAULT '' COMMENT '年购书花费',
  `buy_num` char(1) NOT NULL DEFAULT '0' COMMENT '年购书数量',
  `condition` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '公共阅读设施硬件满意度',
  `resource` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '公共阅读设施文献资源满意度',
  `environment` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '公共阅读设施阅读环境满意度',
  `service` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '公共阅读设施服务态度满意度',
  `info` varchar(255) NOT NULL DEFAULT '' COMMENT '备注',
  `state` int(1) unsigned NOT NULL DEFAULT '0' COMMENT '合法标记：0：初始化数据，1：合法数据',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1024 DEFAULT CHARSET=utf8 COMMENT='问卷';

