# Structure for table "re_score"
#

CREATE TABLE `re_score` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `level1` varchar(45) NOT NULL DEFAULT '' COMMENT '一级指标',
  `level2` varchar(45) NOT NULL DEFAULT '' COMMENT '二级指标',
  `level3` varchar(45) NOT NULL DEFAULT '' COMMENT '三级指标',
  `area` varchar(45) NOT NULL DEFAULT '' COMMENT '行政区',
  `score` int(11) NOT NULL DEFAULT '0' COMMENT '得分',
  `area_id` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '行政区ID',
  PRIMARY KEY (`id`),
  KEY `area` (`area`)
) ENGINE=InnoDB AUTO_INCREMENT=1024 DEFAULT CHARSET=utf8 COMMENT='全民阅读得分表';

